import React from 'react';
import PropTypes from 'prop-types';
import './Die.css';
class Dice extends React.Component {
    static defaultProps = {
        num: "one"
    }
    render() {
        return (
            <div className={`shaking Dice fas fa-dice-${this.props.num}`}></div>
        )
    }
}


Dice.propTypes = {
     num: PropTypes.oneOf(['one','two','three','four','five','six'])
}
export default Dice
